INSERT INTO `blog` (`id`, `blog_title`, `blog_category`, `blog_thumbnail`, `blog_short_desc`, `blog_long_description`, `status`, `created_at`, `updated_at`) VALUES
(12, 'Netflix', '6', 'upload/blog/6173341693291961.jpg', 'What you don’t get in classrooms’: Cybersecurity contest pits students against ransomware ‘attackers', '<p style=\"box-sizing: inherit; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; margin: 32px 0px; max-width: 100%; font-size: 17px; color: #111111; font-family: \'Open Sans\', Georgia, \'serif\'; background-color: #ffffff;\">As ransomware attacks continue to plague local government entities &mdash; Bexar County Appraisal District was the latest victim &mdash; hackers&rsquo; methods and organizations have become more sophisticated. At least&nbsp;<a style=\"box-sizing: inherit; background-color: transparent; transition: color 110ms ease-in-out 0s; color: dimgray;\" href=\"https://www.cnbc.com/2022/04/14/conti-ransomware-leak-shows-group-operates-like-normal-tech-company.html\" target=\"_blank\" rel=\"noreferrer noopener\">one hacker group</a>&nbsp;identified by the FBI appears to have an HR department, performance reviews, and an &ldquo;employee of the month.&rdquo;</p>\r\n<p style=\"box-sizing: inherit; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; margin: 32px 0px; max-width: 100%; font-size: 17px; color: #111111; font-family: \'Open Sans\', Georgia, \'serif\'; background-color: #ffffff;\">Professionals simulated these complex, highly targeted attacks this week at a student competition in San Antonio, sponsored by Raytheon Technologies as a way to train and recruit the next generation of cybersecurity professionals.</p>\r\n<p style=\"box-sizing: inherit; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; margin: 32px 0px; max-width: 100%; font-size: 17px; color: #111111; font-family: \'Open Sans\', Georgia, \'serif\'; background-color: #ffffff;\">The finals of the National Collegiate Cyber Defense Competition, held at the Hyatt Regency Hill County Resort and Spa from Thursday to Saturday, saw 10 teams from 10 schools across the country play defense against CooThe competition is the largest of its kind in the country, organizers said.</p>\r\n<aside style=\"box-sizing: inherit; margin: 32px 0px; max-width: 100%; color: #111111; font-family: \'Open Sans\', Georgia, \'serif\'; font-size: 20px; background-color: #ffffff;\"></aside>\r\n<p style=\"box-sizing: inherit; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; margin: 32px 0px; max-width: 100%; font-size: 17px; color: #111111; font-family: \'Open Sans\', Georgia, \'serif\'; background-color: #ffffff;\">Students on the teams played the roles of cybersecurity professionals protecting a business under active attack from intruders. Meanwhile, behind closed doors, real cybersecurity professionals acted the part of the hackers, seeking to disrupt and shut down system after system: emails, cloud-based servers, internal data and even the help desk. Points were awarded to teams who repelled the attacks and restored their systems as quickly as possible.</p>\r\n<p style=\"box-sizing: inherit; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; margin: 32px 0px; max-width: 100%; font-size: 17px; color: #111111; font-family: \'Open Sans\', Georgia, \'serif\'; background-color: #ffffff;\">Inside the University of Texas at Austin&rsquo;s team room, sophomore Rishabh Ahlawat worked furiously to configure a firewall that would protect the Longhorns&rsquo; cloud servers and even alert them to new intruders.</p>\r\n<p style=\"box-sizing: inherit; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; margin: 32px 0px; max-width: 100%; font-size: 17px; color: #111111; font-family: \'Open Sans\', Georgia, \'serif\'; background-color: #ffffff;\">The teams&rsquo; computers sprawled across the desks showed blue screens and massive walls of coding text.</p>\r\n<p style=\"box-sizing: inherit; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; margin: 32px 0px; max-width: 100%; font-size: 17px; color: #111111; font-family: \'Open Sans\', Georgia, \'serif\'; background-color: #ffffff;\">&ldquo;It&rsquo;s stressful, but it&rsquo;s a fun kind of stressful,&rdquo; Ahlawat said. The team lost points every minute a product server remained down. His lunch sat untouched in its paper bag.&nbsp;&nbsp;</p>', 'active', '2023-08-29 06:52:41', '2023-08-29 07:00:21'),
(13, 'San Antonio s', '6', 'upload/blog/6930101693292298.png', 'San Antonio startup wins first BioFest Invest pitch competition', '<p style=\"box-sizing: inherit; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; margin: 32px 0px; max-width: 100%; font-size: 17px; color: #111111; font-family: \'Open Sans\', Georgia, \'serif\'; background-color: #ffffff;\">The roughly seven-year-old company found support from many San Antonio organizations, such as Launch SA, Velocity TX, UT Health San Antonio and many others.</p>\r\n<p style=\"box-sizing: inherit; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; margin: 32px 0px; max-width: 100%; font-size: 17px; color: #111111; font-family: \'Open Sans\', Georgia, \'serif\'; background-color: #ffffff;\">&ldquo;There&rsquo;s a lot of resources here, and if you&rsquo;re open-minded you can really learn a lot in a short time,&rdquo; said Cornell, the company&rsquo;s CEO.</p>\r\n<p style=\"box-sizing: inherit; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; margin: 32px 0px; max-width: 100%; font-size: 17px; color: #111111; font-family: \'Open Sans\', Georgia, \'serif\'; background-color: #ffffff;\">She said the $10,000 will likely go toward animal studies and packaging for the technology. &nbsp;</p>\r\n<p style=\"box-sizing: inherit; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; margin: 32px 0px; max-width: 100%; font-size: 17px; color: #111111; font-family: \'Open Sans\', Georgia, \'serif\'; background-color: #ffffff;\">Judges for the pitch competition included local figures involved in the bioscience sector, including Osman &Ouml;zturgut, a business professor and dean of the University of the Incarnate Word&rsquo;s School of Professional Studies. Also judging was Brian Kieser, a partner at San Antonio-based investment firm Fountainhead, as well as a founder at local biologics manufacturer Nvision Biomedical Technologies. Another judge was Walter Downing<span style=\"box-sizing: inherit; font-weight: bolder;\">,</span>&nbsp;the chief operating officer of Southwest Research Institute, which has taken an&nbsp;<a style=\"box-sizing: inherit; background-color: transparent; transition: color 110ms ease-in-out 0s; color: dimgray;\" href=\"https://www.swri.org/press-release/san-antonio-precision-therapeutics-partnership\">active role</a>&nbsp;in developing San Antonio&rsquo;s biosciences field.</p>\r\n<p style=\"box-sizing: inherit; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; margin: 32px 0px; max-width: 100%; font-size: 17px; color: #111111; font-family: \'Open Sans\', Georgia, \'serif\'; background-color: #ffffff;\">The runner-up to NovoThelium was San Antonio-based Vascular Perfusion Solutions, which develops medical devices to preserve and resuscitate organs.</p>\r\n<p style=\"box-sizing: inherit; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; margin: 32px 0px; max-width: 100%; font-size: 17px; color: #111111; font-family: \'Open Sans\', Georgia, \'serif\'; background-color: #ffffff;\">Heather Hanson, president of BioMedSA, said the aim of the all-day event it organized was to expose entrepreneurs to investors, and to connect them with resources and organizations that can help them navigate regulations, government contracts and other specialties involved in launching a new bioscience company. Expert panels spoke on topics in finance, health care and technology.</p>', 'active', '2023-08-29 06:58:18', '2023-08-29 07:00:22'),
(14, 'First, get the tech', '6', 'upload/blog/6882461693292370.jpg', 'First, get the tech: Unless India develops domestic AI heft, it wouldn’t play any meaningful part in global regulatory efforts', '<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 16px; font-size: 16px; line-height: 28px; color: #1a1a1a; font-family: Montserrat, Arial, Helvetica, sans-serif; letter-spacing: -0.2px; background-color: #ffffff;\">tudents have been abuzz over how artificial intelligence tools can do their homework and programmers over how these can increase their productivity or take away their jobs. As much as digitisation has transformed the country in recent years, there is a widespread feeling that at some point around the horizon AI shall rejig everything in even more fundamental, fantastic and frightening ways. This is why deciding how the coming changes should be regulated is very important. Trai has made a strong case for an independent statutory authority to ensure the responsible development and use of AI in the country, a global agency along similar lines shall likely be pitched at the G20 leaders&rsquo; summit, and interestingly even American MNC Microsoft has floated a blueprint for AI governance in India. The great size and diversity of its &ldquo;data points&rdquo; make India of great interest to all developers of AI technologies.</p>\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 16px; font-size: 16px; line-height: 28px; color: #1a1a1a; font-family: Montserrat, Arial, Helvetica, sans-serif; letter-spacing: -0.2px; background-color: #ffffff;\">&nbsp;</p>', 'active', '2023-08-29 06:59:30', '2023-08-29 07:00:23'),
(15, 'Testing', '9', 'upload/blog/9683861693301519.jpg', 'blog_long_description', '<p>test</p>', 'active', '2023-08-29 09:31:59', '2023-08-29 12:05:28');
