(1, '123Loadboard', 'https://logo.clearbit.com/123loadboard.com', 'A freight matching service for truckers and brokers.', '123Loadboard provides a freight matching web and mobile app marketplace for carriers, owner-operators, brokers, and shippers. This platform offers tools to find truck loads, make real-time freight tracking, and streamline the trucking business to ensure more profitability and a simpler workflow.', 'US$35/Month', 'https://members.123loadboard.com/unsubscribe/', 'nil', '877-875-5301', 'https://www.123loadboard.com/login/', 'Yes', 'Yes', 'Yes', 'Yes', 'Yes', 'Finance & Professional Services', 'Professional Networking & Contacts', 'Freight Matching, Load Boards', '123Loadboard', NULL, NULL, 'https://www.123loadboard.com/pricing/', NULL, NULL, NULL, '2023-08-10 09:18:51', 'admin_created', '2023-08-10 09:18:51'),
(2, 'Phase It Up', 'TBA', 'A personalized women\'s weight loss coaching program.', 'Phase It Up is a unique weight loss coaching program designed specifically for women. It\'s not just a diet, but a holistic approach to create healthier habits for lasting weight loss. The program includes daily accountability coaching, easy-to-follow meal plans, and a community for support. It focuses on restoring confidence, balancing hormones, igniting metabolism, and healing the gut to transform your body into a fat-burning machine. In three steps - join, learn, and celebrate - you progress towards your health goals. The program includes a monthly subscription with regular updates, personalized tracking, and motivational support from the founder, Chalene.', 'US$14.99/Month', 'https://phaseitup.prupel.com/wp-login.php', 'customerservice@131method.com', 'Nil', 'https://phaseitup.prupel.com/wp-login.php', 'Yes', 'No', 'Yes', 'No', 'No', 'Health & Wellness', 'Fitness & Exercise', 'Weight Loss, Nutrition, Fitness, Women', 'Phase it Up', NULL, NULL, 'https://phaseitup.prupel.com/', NULL, NULL, NULL, '2023-08-10 09:18:51', 'admin_created', '2023-08-10 09:18:51'),
