(30, 'Barkbox', 'https://logo.clearbit.com/barkbox.com', 'BarkBox is a monthly surprise of dog toys, treats, and goodies!', 'BarkBox is a delightful subscription service tailored for dogs. Each month, a curated box arrives at your doorstep, filled with high-quality toys, all-natural treats, and innovative chews, designed to keep your furry friend engaged and entertained. With themes that change monthly, BarkBox adds excitement to playtime and ensures tail-wagging joy. Their commitment to quality and safety ensures happy and healthy dogs everywhere. Join the BarkBox community, where fun and love for your canine companion never stop!', 'US$35/Month', 'https://www.barkbox.com/contact-us', 'happy@barkbox.com', 'nil', 'https://www.barkbox.com/login', 'No', 'No', 'Yes', 'No', 'No', 'Pets & Animals', 'Pet Toys & Accessories, Subscription Box', 'Pet Food & Treats, Dog Toys, Dog Treats', 'BarkBox', NULL, 'https://track.flexlinkspro.com/g.ashx?foid=156074.1369.401277&trid=1255600.179044&foc=16&fot=9999&fos=5', 'https://www.barkbox.com/subscribe', NULL, NULL, NULL, '2023-08-10 09:18:51', 'admin_created', '2023-08-10 09:18:51'),
