(37, '2Checkout', 'TBA', '2Checkout, now Verifone, is a leading online payment platform that enables businesses to accept payments and manage subscription services globally. ', '2Checkout, now Verifone, is a leading online payment platform that enables businesses to accept payments and manage subscription services globally. With a seamless and secure checkout process, it supports multiple payment methods and currencies, providing a smooth experience for customers worldwide. Tailored for businesses of all sizes, 2Checkout\'s flexible subscription management system allows easy setup, billing, and recurring payment handling.', 'Dependent on service', NULL, 'info@2checkout.com', '(650) 963 - 5701', NULL, NULL, NULL, NULL, NULL, 'No', 'Finance & Professional Services', 'Financial Services & Investments', 'Online Payments, Payment Gateway', 'Verifone', NULL, NULL, 'https://www.2checkout.com/pricing/2sell/', NULL, NULL, NULL, '2023-08-10 09:18:51', 'admin_created', '2023-08-10 09:18:51'),
(38, 'Craft Beer Club', 'https://logo.clearbit.com/craftbeerclub.com', 'A subscription service delivering craft beers.', 'Craft Beer Club is a subscription service that delivers a selection of exceptional craft beers from across the US. Each shipment includes 12 beers from independent breweries, featuring a variety of styles and flavors, along with a newsletter detailing the beers and suggested food pairings.', 'US$47.95/Month', 'https://craftbeerclub.com/account/login', 'support@craftbeerclub.com', '1-800-200-2959', 'https://craftbeerclub.com/account/login', 'Yes', 'No', 'Yes', 'Yes', 'No', 'Food & Beverages', 'Craft Beverages, Subscription Box', 'Craft Beer, Beer', 'Craft Beer Club', NULL, NULL, 'https://craftbeerclub.com/account/register', NULL, NULL, NULL, '2023-08-10 09:18:51', 'admin_created', '2023-08-10 09:18:51'),
