(48, 'Freshly', 'https://logo.clearbit.com/freshly.com', 'Freshly is a weekly subscription service delivering healthy and fully prepared meals directly to a customerâ€™s doorstep.', 'Freshly is a weekly subscription service delivering healthy and fully prepared meals directly to a customerâ€™s doorstep. The rotating weekly menu offers 30 different flavorful preparations and combinations that are chef-made with the highest quality, 100% all natural ingredients that meet industry leading standards. Each deliciously healthy meal is packed with key nutrients and cooked fresh to order with no artificial flavors, colors, sweeteners, refined sugars, artificial preservatives or hydrogenated oils.', 'US$49.99 (4 meels/week)', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Food & Beverages', 'Meal Kits, Subscription Box', 'Prepared Meals, Healthy Eating', 'Birchbox Man', NULL, NULL, NULL, NULL, NULL, NULL, '2023-08-10 09:18:51', 'admin_created', '2023-08-10 09:18:51'),
